arr = []
for i in range(num_count):
    num = int(input(f"Enter element {i + 1}: "))
    arr.append(num)

target = int(input("Enter the element to search for: "))

result = linear_search(arr, target)

if result != -1:
    print(f"Element {target} found at index {result}.")
else:
