public class Coins {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        double coins = Double.parseDouble(scanner.nextLine());
        coins *= 100;

        int countCoins = 0;

        while (coins > 0) {
            if (coins >= 200) {
                coins -= 200;
            } else if (coins >= 100) {
                coins -= 100;
            } else if (coins >= 50) {
                coins -= 50;
            } else if (coins >= 20) {
                coins -= 20;
            } else if (coins >= 10) {
                coins -= 10;
            } else if (coins >= 5) {
                coins -= 5;
            } else if (coins >= 2) {
                coins -= 2;
            } else if (coins >= 1) {
                coins -= 1;
            } else {
                break;
            }

            countCoins++;
        }

        System.out.println(countCoins);

    }
}

package _05_WhileLoops;

import java.util.Scanner;

public class Walking {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int goal = 10000;


        while (goal > 0) {
            String input = scanner.nextLine();
            if (input.equals("Going home")) {
                int tiredSteps = Integer.parseInt(scanner.nextLine());
                goal -= tiredSteps;
                break;
            }

            int steps = Integer.parseInt(input);

            goal = goal - steps;
            // goal -= steps;
        }


        if (goal <= 0) {
            System.out.printf("Goal reached! Good job!%n" +
                    "%d steps over the goal!", Math.abs(goal));
        } else {
            System.out.printf("%d more steps to reach goal.", goal);
        }
    }
}

package _05_WhileLoops;

import java.util.Scanner;

public class Vacation {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        double tripPrice = Double.parseDouble(scanner.nextLine());
        double currentMoney = Double.parseDouble(scanner.nextLine());

        int spendRow = 0;
        int all = 0;

        while (true) {
            String name = scanner.nextLine();
            double n = Double.parseDouble(scanner.nextLine());
            all++;

            if(name.equals("save")) {
                currentMoney += n;
                spendRow = 0;

            } else if(name.equals("spend")) {
                currentMoney -= n;
                spendRow++;

                if(currentMoney < 0) {
                    currentMoney = 0;
                }
            }

            if(currentMoney >= tripPrice) {
                System.out.printf("You saved the money for %d days.", all);
                break;
            }

            if(spendRow == 5) {
                System.out.printf("You can't save the money.%n%d", all);
                break;
            }
        }

    }
}

