#include <iostream>
#include <vector>
using namespace std;
const int maxn = 2e5 + 10;
typedef long long ll;
ll pref_sum[maxn];

ll query(int i, int j) {
    if(i == 0) {
        return pref_sum[j];
    }
    return pref_sum[j] - pref_sum[i - 1];
}
int main() {
    ios_base::sync_with_stdio(false);
    int n;
    ll m;
    cin >> n >> m;
    
    vector<ll> v(n);
    ll sum = 0;
    for(int i = 0; i < n; i++) {
        cin >> v[i];
        sum += v[i];
        pref_sum[i] = sum;
    }
    int res = 0;
    for(int i = 0; i < n; i++) {
        int L = i, R = n - 1;
        int j = 0;
        while(L <= R) {
            int mid = (L + R) / 2;
            if(query(i, mid) <= m) {
                L = mid + 1;
                j = max(j, mid);
            }
            else {
                R = mid - 1;
            }
        }
        res = max(res, j - i + 1);
    }
    cout << res << endl;
    return 0;
}

#include <iostream>
#include <vector>
#include <map>
#include <algorithm>

using namespace std;

void radixsortABC(vector<pair<string, string>>& data, int index) {
    vector<vector<pair<string, string>>> letter(26);

    for (int i = 0; i < data.size(); i++) {
        letter[(int)data[i].first[index] - 65].emplace_back(data[i].first, data[i].second);
    }

    vector<pair<string, string>> new_data;
    for (int i = 0; i < 26; i++) {
        for (int j = 0; j < letter[i].size(); j++) {
            new_data.emplace_back(letter[i][j].first, letter[i][j].second);
        }
    }

    data = new_data;
}

void radixsortNatural(vector<pair<string, string>>& data, int index) {
    vector<vector<pair<string, string>>> digit(10);

    for (int i = 0; i < data.size(); i++) {
        digit[data[i].first[index] - '48'].emplace_back(data[i].first, data[i].second);
    }

    vector<pair<string, string>> new_data;
    for (int i = 0; i < 10; i++) {
        for (int j = 0; j < digit[i].size(); j++) {
            new_data.emplace_back(digit[i][j].first, digit[i][j].second);
        }
    }

    data = new_data;
}

void input(vector<pair<string, string>>& data) {
    string first_letter, numbers, last_letters, datafirst, datasecond;

    while (cin >> first_letter) {
        cin >> numbers >> last_letters >> datasecond;
        datafirst = first_letter + numbers + last_letters;
        data.emplace_back(datafirst, datasecond);
    }
}

void output(vector<pair<string, string>>& data) {
    for (int i = 0; i < data.size(); i++) {
        cout << data[i].first[0] << " " << data[i].first[1] << data[i].first[2] << data[i].first[3] << " " << data[i].first[4] << data[i].first[5];
        cout << "\t" << data[i].second << endl;
    }
}

int main() {
    vector<pair<string, string>> data;
    input(data);

    radixsortABC(data, 5);
    radixsortABC(data, 4);
    radixsortNatural(data, 3);
    radixsortNatural(data, 2);
    radixsortNatural(data, 1);
    radixsortABC(data, 0);

    output(data);

    return 0;
}

#include <iostream>
#include <vector>
using namespace std;

int main() {
    ios_base::sync_with_stdio(false);
    int n, k;
    cin >> n >> k;
    
    vector<int> v(n);
    for(int i = 0; i < n; i++) {
        cin >> v[i];
        
        if(v[i] == 0) {
            v[i] = 1;
        }
        else {
            v[i] = 0;
        }
    }
    int j = 0;
    int sum = 0;
    int res = 0, s_idx = -1;
    for(int i = 0; i < n; i++) {
        while(j < n and sum + v[j] <= k) {
            sum += v[j];
            j++;
        }
        sum -= v[i];
        if(j - i > res) {
            res = j - i;
            s_idx = i;
        }
    }
    cout << res << endl;
    for(int i = s_idx; i < s_idx + res; i++) {
        if(v[i] == 1) {
            cout << i + 1 << " ";
        }
    }
    return 0;
}

