// Function to simulate the clicks
function simulateClicks() {
    // Counter to control the number of iterations
    var counter = 0;

    // Function to execute the code block
    function executeClicks() {
        if (counter < 1000) {
            document.querySelector("#lootboxes-tab > div.headerContainer__70a91 > div.headerCTA_c0a44b > button").click();

            // Add a random delay here (between 500 and 1500 milliseconds)
            var delay1 = Math.floor(Math.random() * 1000) + 500;
            setTimeout(function() {
                // Calculate the middle of the screen
                var middleX = window.innerWidth / 2;
                var middleY = window.innerHeight / 2;

                // Create a new click event
                var clickEvent = new MouseEvent('click', {
                    'view': window,
                    'bubbles': true,
                    'cancelable': true,
                    'clientX': middleX,
                    'clientY': middleY
                });

                // Dispatch the click event
                document.elementFromPoint(middleX, middleY).dispatchEvent(clickEvent);

                // Add another random delay here (between 500 and 1500 milliseconds)
                var delay2 = Math.floor(Math.random() * 1000) + 500;
                setTimeout(function() {
                    // Calculate the coordinates for the top right corner
                    var topRightX = window.innerWidth - 50; // 50 pixels from the right edge
                    var topRightY = 50; // 50 pixels from the top edge

                    // Create a new click event
                    var clickEvent = new MouseEvent('click', {
                        'view': window,
                        'bubbles': true,
                        'cancelable': true,
                        'clientX': topRightX,
                        'clientY': topRightY
                    });

                    // Dispatch the click event
                    document.elementFromPoint(topRightX, topRightY).dispatchEvent(clickEvent);

                    // Increment the counter
                    counter++;

                    // Call the function recursively to execute the next iteration
                    executeClicks();
                }, delay2);
            }, delay1);
        }
    }

    // Start executing the code block
    executeClicks();
}

// Call the function to start simulating clicks
