#include <iostream>
#include <vector>

void quickSort(std::vector<int>& array, int leftIndex, int rightIndex) {
    if (leftIndex <= rightIndex) {
        int pivot = (array[leftIndex] + array[(leftIndex + rightIndex) / 2] + array[rightIndex]) / 3;
        int start = leftIndex, end = rightIndex;
        
        while (start <= end) {
            while (array[start] < pivot) {
                start++;
            }
            while (array[end] > pivot) {
                end--;
            }
            if (start <= end) {
                if (start < end) {
                    std::swap(array[start], array[end]);
                }
                
                start++;
                end--;
            }
        }
        quickSort(array, leftIndex, end);
        quickSort(array, start, rightIndex);
    } else {
        return;
    }
}



int main() {
    
    
    
    int size;
    std::cin >> size;
    
    std::vector<int> array(size);
    for (auto& element : array) {
        std::cin >> element;
    }
    
    quickSort(array, 0, size - 1);
    
    for (auto element : array) {
        std::cout << element << ' ';
    }
    return 0;
}

#include <stdio.h>
#include <stdbool.h>
#include <math.h>

bool isPrime(int num) {
    int last = (int) sqrt(num);

    for (int i = 2; i <= last; ++i) {
        if (num % i == 0)
            return false;
    }

    return true;
}

int main() {
    for (int i = 1; i <= 1000; ++i) {
        if (isPrime(i)) {
            printf("[%d]", i);
        }
    }
}

