In the Admin dashboard, this code is used for fetching the username, updating/inserting user into a user-defined table "users" using UUID(which is auto-generated during login)

const AdminDashboard = () => {

    const [currentComponent, setCurrentComponent] = useState('Profile');
    const [userDetails, setUserDetails] = useState(null);
    const [isLoading, setIsLoading] = useState(true);

    const [username, setUsername] = useState('');

  useEffect(() => {
    // Retrieve the username from localStorage when the component mounts
    const storedUsername = localStorage.getItem('username');
    if (storedUsername) {
      setUsername(storedUsername);
    }

    // Optional: Clear the username from localStorage if it's no longer needed
    localStorage.removeItem('username');
  }, []);

    const navigate = useNavigate();

    useEffect(() => {
        const fetchUserDetails = async () => {
        const { data: user, error } = await supabase.auth.getUser();
        
        if (error || !user) {
            // If there's an error or no user data, redirect to login page
            navigate('/');
            return; // Stop further execution in this hook
        }        
        setUserDetails(user);
        
        // Below line prints a json in the console which can be used to fetch different elements
        console.log(JSON.stringify(user, null, 2));
     
        // Fetching elements from the json
        console.log(user.user.id); // For getting the auto generated UserID
        console.log(user.user.user_metadata.avatar_url); // For getting the avatar image of user's Google account
        console.log(user.user.user_metadata.full_name); // For getting the Full name of user's Google account
        await createOrUpdateUser(user, username);
        setIsLoading(false);
        };

        fetchUserDetails();
    }, []);

    
    const createOrUpdateUser = async (user, username) => {
        // Upsert user data
        const { data, error } = await supabase
            .from('users')
            .upsert([
                { user_id: user.user.id, 
                  username: username,
                  name: user.user.user_metadata.full_name } 
            ], {
                // Specify the conflict resolution column
                onConflict: 'user_id' // This is my primary key
            });
    
        if (error) {
            console.error('Error upserting user in Supabase', error);
        }     };

