import numpy as np

M = 10
n = 20


def print_result(day, a_action, b_action, result):
    print(f"{day=}, {a_action=}, {b_action=}, {result=}")


yesterday = np.zeros((1000, 100), dtype=np.int32)
today = np.zeros((1000, 100), dtype=np.int32)
for day in range(1, 100000):
    # 已经完成的操作数
    for a_action in range(day * M):
        for b_action in range(day * M):
            # 三种操作的结果
            tmp = np.zeros(3, dtype=np.int32)
            if day * M - 2 * a_action - 5 * b_action < 0:
                break
            tmp[0] = yesterday[a_action, b_action]
            # 余钱可以执行A操作
            if day * M - 2 * a_action - 5 * b_action - 2 >= 0:
                tmp[1] = yesterday[a_action - 1, b_action]
            # 余钱可以执行B操作
            if day * M - 2 * a_action - 5 * b_action - 5 >= 0:
                tmp[2] = yesterday[a_action, b_action - 1] + a_action * 2

            if (tmp >= n).any():
                max_act = np.argwhere(tmp >= n)
                for each_act in max_act:
                    if each_act[0] == 0:
                        print_result(day, a_action, b_action, tmp[0])
                    elif each_act[0] == 1:
                        print_result(day, a_action + 1, b_action, tmp[1])
                    else:
                        print_result(day, a_action, b_action + 1, tmp[2])

            today[a_action, b_action] = max(tmp)
    yesterday = np.copy(today)
    today.fill(0)

    if np.max(yesterday) >= n:
        # print(f"{day=}")
        break

